extern int fontwidth, fontheight;
extern int fontoffset;
extern unsigned char fontbytes[];
extern unsigned char fontmask;

int screen_width_bytes = 62; // 22; // 31;
int screen_height = 262;
int screen_byte_count = screen_width_bytes * screen_height;
int screen_width_pixels = screen_width_bytes * 8;

int textport_left_margin_pixels = 3 * 8;
int textport_left_margin_bytes = textport_left_margin_pixels / 8;
int textport_right_margin_pixels = 2 * 8;
int textport_top_margin = 5;
int textport_bottom_margin = 5;

int textport_columns = (screen_width_pixels - textport_left_margin_pixels - textport_right_margin_pixels) / fontwidth;
int textport_rows = (screen_height - textport_top_margin - textport_bottom_margin) / fontheight;

unsigned char *screen;
int cursor_x;
int cursor_y;

unsigned char *cursor_ptr;
int cursor_bit;

