int textport_start_bit;
int textport_leftcolumn_bit = textport_left_margin_pixels % 8;
int textport_righcolumn_bit = (textport_left_margin_pixels + (textport_columns - 1) * fontwidth) % 8;

rfbScreenInfoPtr rfb_server;
int video_rfb_scale_x = 2;
int video_rfb_scale_y = 2;
bool quit;

uint32_t rfb_pixel(int  r, int g, int b)
{
    return (r << 16) | (g << 8) | (b);
}

int modified_minx;
int modified_miny;
int modified_maxx;
int modified_maxy;

void rfb_reset_modified_rect()
{
    modified_minx = 10000;
    modified_miny = 10000;
    modified_maxx = 0;
    modified_maxy = 0;
}

void rfb_send_modified_rect()
{
    if((modified_maxx - modified_minx > 0) && (modified_maxy - modified_miny > 0)) {
        rfbMarkRectAsModified(rfb_server, modified_minx, modified_miny, modified_maxx, modified_maxy);
        rfb_reset_modified_rect();
    }
}

void rfb_add_modified_point(int x, int y)
{
    modified_minx = std::min(modified_minx, x);
    modified_miny = std::min(modified_miny, y);
    modified_maxx = std::max(modified_maxx, x + 1);
    modified_maxy = std::max(modified_maxy, y + 1);
}

void rfb_add_modified_rect(int minx, int miny, int maxx, int maxy)
{
    modified_minx = std::min(modified_minx, minx);
    modified_miny = std::min(modified_miny, miny);
    modified_maxx = std::max(modified_maxx, maxx);
    modified_maxy = std::max(modified_maxy, maxy);
}

void rfb_set_pixel_from_video(int video_x, int video_y, bool set)
{
    int rfb_x = video_x * video_rfb_scale_x;
    int rfb_y = video_y * video_rfb_scale_y;
    int v = set ? 255 : 0;

    for(int j = 0; j < video_rfb_scale_y; j++)
        for(int i = 0; i < video_rfb_scale_x; i++) {
            unsigned char *fb = (unsigned char *)rfb_server->frameBuffer + ((rfb_y + j) * rfb_server->width + rfb_x + i) * 4;
            fb[0] = v;
            fb[1] = v;
            fb[2] = v;
            rfb_add_modified_point(rfb_x + i, rfb_y + j);
        }
}

void rfb_fill_from_video()
{
    for(int j = 0; j < screen_height; j++) {
        for(int i = 0; i < screen_width_bytes; i++) {
            for(int k = 0; k < 8; k++) {
                int video_x = i * 8 + k;
                int video_y = j;
                int set = screen[j * screen_width_bytes + i] & (0x80 >> k);

                int rfb_x = video_x * video_rfb_scale_x;
                int rfb_y = video_y * video_rfb_scale_y;
                int v = set ? 255 : 0;

                for(int p = 0; p < video_rfb_scale_y; p++)
                    for(int q = 0; q < video_rfb_scale_x; q++) {
                        unsigned char *fb = (unsigned char *)rfb_server->frameBuffer + ((rfb_y + p) * rfb_server->width + rfb_x + q) * 4;
                        fb[0] = v;
                        fb[1] = v;
                        fb[2] = v;
                    }
            }
        }
    }
    rfb_add_modified_rect(0, 0, rfb_server->width, rfb_server->height);
}

void update_rfb_from_screen_byte(unsigned char* p)
{
    int addr = p - screen;
    int pixel_start = addr * 8;
    int pixel_row = pixel_start / screen_width_pixels;
    unsigned char data = *p;
    if(pixel_row < screen_height) {
        int pixel_column_start = pixel_start - (pixel_row * screen_width_pixels);
        for(int i = 0; i < 8; i++) {
            rfb_set_pixel_from_video(pixel_column_start + i, pixel_row, data & (0x80 >> i));
        }
    }
}

void textport_set_cursor(int x, int y)
{
    if(y < 0) {
        x = 0; y = 0;
    } else if(y >= textport_rows) {
        x = textport_columns - 1;
        y = textport_rows - 1;
    } else if(x < 0) {
        x = 0;
    } else if(x >= textport_columns) {
        x = textport_columns - 1;
    }
    cursor_x = x;
    cursor_y = y;
    int bit = x * fontwidth;
    int bytes = bit / 8;
    cursor_ptr = textport_start_ptr + bytes + y * screen_width_bytes * fontheight;
    cursor_bit = bit - bytes * 8;
}

void screen_init()
{
    screen = new unsigned char[screen_byte_count];
    textport_start_ptr = screen + textport_top_margin * screen_width_bytes + textport_left_margin_bytes;
    textport_set_cursor(0, 0);
}

void screen_clear()
{
    unsigned char *p = screen;
    for(int i = screen_byte_count; i != 0; i--, p++) {
        *p = 0;
        update_rfb_from_screen_byte(p);
    }
}

int text_flag_none = 0x00;
int text_flag_inverse = 0x01;

void get_byte_masks(int screen_bit, unsigned char& mask1, unsigned char& mask2, int& do_byte2)
{
    mask1 = fontmask;
    for(int bit = screen_bit; bit > 0; bit--) {
        // convert to Z80 assembly:
        mask1 >>= 1U;
    }

    mask2 = fontmask;
    for(int bit = 8 - screen_bit; bit > 0; bit--) {
        // convert to Z80 assembly:
        mask2 <<= 1U;
    }
    
    do_byte2 = (screen_bit + fontwidth) > 8;
}


void textport_draw_character(unsigned char c, int flags)
{
    unsigned char *screen_ptr = cursor_ptr;
    int screen_bit = cursor_bit;

    if(c < fontoffset)
        c = ' ';

    unsigned char *font_ptr = fontbytes + fontheight * (c - fontoffset);

    unsigned char mask1, mask2;
    int do_byte2;
    get_byte_masks(screen_bit, mask1, mask2, do_byte2);
    mask1 ^= 0xff;
    mask2 ^= 0xff;

    for(int row = fontheight; row != 0; row--) {
        unsigned char font_byte = *font_ptr;

        if(flags & text_flag_inverse)
            font_byte ^= fontmask;

        // made a loop to look more like assembly
        for(int bit = screen_bit; bit > 0; bit--) {
            font_byte >>= 1U;
        }

        unsigned char pixels = *screen_ptr;
        pixels &= mask1;
        pixels |= font_byte;
        *screen_ptr = pixels;
        update_rfb_from_screen_byte(screen_ptr);

        screen_ptr ++;

        if(do_byte2) {
            font_byte = *font_ptr;

            if(flags & text_flag_inverse)
                font_byte ^= fontmask;

            // made a loop to look more like assembly
            for(int bit = 8 - screen_bit; bit > 0; bit--) {
                font_byte <<= 1U;
            }

            if(flags & text_flag_inverse)
                font_byte ^= fontmask;

            pixels = *screen_ptr;
            pixels &= mask2;
            pixels |= font_byte;
            *screen_ptr = pixels;
            update_rfb_from_screen_byte(screen_ptr);
        }

        font_ptr++;
        screen_ptr += screen_width_bytes - 1;
    }
}

void textport_invert_at_cursor()
{
    unsigned char *screen_ptr = cursor_ptr;
    int screen_bit = cursor_bit;

    unsigned char mask1, mask2;
    int do_byte2;
    get_byte_masks(screen_bit, mask1, mask2, do_byte2);

    for(int row = fontheight; row != 0; row--) {
        unsigned char pixels = *screen_ptr;
        pixels ^= mask1;
        *screen_ptr = pixels;
        update_rfb_from_screen_byte(screen_ptr);

        screen_ptr ++;

        if(do_byte2) {
            pixels = *screen_ptr;
            pixels ^= mask2;
            *screen_ptr = pixels;
            update_rfb_from_screen_byte(screen_ptr);
        }

        screen_ptr += screen_width_bytes - 1;
    }
}

void screen_scroll_one_row()
{
    unsigned char *screen_ptr = textport_start_ptr;
    unsigned char *next_row_ptr = textport_start_ptr + screen_width_bytes * fontheight;

    for(int i = (textport_rows - 1) * screen_width_bytes * fontheight; i > 0; i--) {
        *screen_ptr++ = *next_row_ptr++;
    }
    for(int i = screen_width_bytes * fontheight; i > 0; i--) {
        *screen_ptr++ = 0;
    }
    rfb_fill_from_video();
}

void screen_cursor_rewind()
{
    if(cursor_x == 0) {
        if(cursor_y == 0) {
            return;
        } else {
            cursor_x = textport_columns - 1;
            cursor_y--;
            textport_set_cursor(cursor_x, cursor_y);
        }
    } else {
        cursor_x--;
        if(cursor_bit < fontwidth) {
            cursor_bit += 8;
            cursor_ptr --;
        }
        cursor_bit -= fontwidth;
    }
}

void screen_cursor_forward()
{
    // printf("%d, %d, %ld\n", cursor_x, cursor_y, cursor_ptr - screen);
    cursor_x ++;
    cursor_bit += fontwidth;
    if(cursor_bit > 7) {
        cursor_bit -= 8;
        cursor_ptr ++;
    }
    if(cursor_x >= textport_columns) {
        cursor_x = 0;
        cursor_y++;
        if(cursor_y >= textport_rows) {
            screen_scroll_one_row();
            cursor_y--;
        }
        textport_set_cursor(cursor_x, cursor_y);
    }
}

void screen_cursor_newline()
{
    cursor_y++;
    cursor_ptr += screen_width_bytes * fontheight;
    if(cursor_y >= textport_rows) {
        screen_scroll_one_row();
        cursor_y--;
        cursor_ptr -= screen_width_bytes * fontheight;
    }
}

void screen_cursor_carriage_return()
{
    cursor_x = 0;
    textport_set_cursor(cursor_x, cursor_y);
}

void screen_print_char(unsigned char c)
{
    if(c == '\r') {
        textport_invert_at_cursor();
        screen_cursor_carriage_return();
        textport_invert_at_cursor();
    } else if(c == '\n') {
        textport_invert_at_cursor();
        screen_cursor_newline();
        textport_invert_at_cursor();
    } else if(c == '' || c == '') {
        textport_invert_at_cursor();
        screen_cursor_rewind();
        textport_draw_character(' ', text_flag_none);
        textport_invert_at_cursor();
    } else {
        textport_draw_character(c, text_flag_none);
        screen_cursor_forward();
        textport_draw_character(' ', text_flag_none);
        textport_invert_at_cursor();
    }
}

void screen_print_string(unsigned char *str)
{
    while(*str) {
        screen_print_char(*str++);
    }
}

bool pass_key = false;
int pipe_to_subprocess = -1;
int pipe_from_subprocess;
bool control_down = false;

void handleKey(rfbBool down, rfbKeySym key, rfbClientPtr cl)
{
    if(down) {
        if(key == XK_Control_L || key == XK_Control_R) {
            control_down = true;
        } else if(key == XK_Escape) {
            if(pass_key) {
                key = '';
                write(pipe_to_subprocess, &key, 1);
            }
        } else if(key == XK_F12) {
            /* close down server, disconnecting clients */
            rfbShutdownServer(cl->screen,TRUE);
            quit = true;
        } else if(key == XK_F11) {
            /* close down server, but wait for all clients to disconnect */
            rfbShutdownServer(cl->screen,FALSE);
            quit = true;
        } else if(key == XK_F11) {
            /* close down server, but wait for all clients to disconnect */
            rfbShutdownServer(cl->screen,FALSE);
            quit = true;
        } else if(control_down && key >= 'a' && key <= 'z') {
            key = key - 96;
            if(pass_key)
                write(pipe_to_subprocess, &key, 1);
        } else if(control_down && key >= 'A' && key <= '_') {
            key = key - 64;
            if(pass_key)
                write(pipe_to_subprocess, &key, 1);
        } else if(key >= ' ' && key <= '~') {
            if(pass_key)
                write(pipe_to_subprocess, &key, 1);
            else
                screen_print_char(key);
        } else if(key == XK_Return) {
            if(pass_key) {
                key = '\n';
                write(pipe_to_subprocess, &key, 1);
            } else {
                screen_print_char('\r');
                screen_print_char('\n');
            }
        } else if(key == XK_BackSpace || key == XK_Delete) {
            if(pass_key) {
                key = '';
                write(pipe_to_subprocess, &key, 1);
            } else {
                textport_invert_at_cursor();
                screen_cursor_rewind();
                textport_draw_character(' ', text_flag_none);
                textport_invert_at_cursor();
            }
        } else
            printf("rfb key 0x%04X\n", key);
    } else {
        if(key == XK_Control_L || key == XK_Control_R) {
            control_down = false;
        }
    }
}

